typedef struct  Celula{
	int tipo;
	char mark;
	struct Celula *fesq;
	struct Celula *fdir;
}Celula;


Celula heap[H];

///      Alocacao de dados
Celula *fl;

/*Estrutura auxiliar para empilhar as celulas
 * */
Celula *pilha[P];
int topo = -1;

//						ALOCACAO DADOS

/*Procedimentos para inserir e remover elementos da pilha
 * */
void push(Celula *c){
	//++ vem antes pois o topo comea em -1
	if(topo < P){
		pilha[++topo] = c;
	}
	else{
		printf("\n##############################\n");
		printf("\n\tPilha cheia\n");
		printf("\n##############################\n");
		exit(0);
	}
}

void pop(){
	topo--;
}

void pop_value(int val){
	topo -= val;
}

/*Procedimento cria um grafo dedicado a free list, gerando uma arvore em pre ordem
 * */
void aloca_freelist(){
	fl = heap;
	Celula *ptr = fl;
	for(int i = 1;i < H;i++){
		ptr->tipo = 0;
		ptr->fesq = NULL;
		ptr->fdir = &heap[i];
		ptr = ptr->fdir;
	}
}

/*Procedimento auxiliar para alocacao de espaco da freelist
 * Retorna o elemento da free list
 * Retorna nulo se a freelist esta vazia
 * */
Celula *aloca_espaco(){
	Celula *retorno;
	retorno = fl;
	if(fl != NULL){
		fl = fl->fdir;
	}
	else{
		printf("\n #############################\n\n\tHeap Cheia!\n\n#############################\n");
		exit(0);
	}

	return retorno;
}

