/*Procedimento auxiliar para converter o valor inteiro de uma clula para caractere
 * */
char converte_celula_caractere(int valor){

	char retorno = '\0';

	switch(valor){
		case 0xF0000000:
			retorno = 'K';
			break;
		case 0xF0000001:
			retorno = 'S';
			break;
		case 0xF0000002:
			retorno = 'I';
			break;
		case 0xF0000003:
			retorno = 'B';
			break;
		case 0xF0000004:
			retorno = 'C';
			break;
		case 0xF0000005:
			retorno = 'D';
			break;
		case 0xF0000006:
			retorno = 'E';
			break;
		case 0xF0000007:
			retorno = 'F';
			break;
		case 0xF0000008:
			retorno = '@';
			break;
		//Operadores aritmeticos
		case 0xF0000009:
			retorno = '+';
			break;
		case 0xF000000A:
			retorno = '-';
			break;
		case 0xF000000B:
			retorno = '*';
			break;
		case 0xF000000C:
			retorno = '/';
			break;
		// Combinadores lgicos
		case 0xF000000D://TRUE
			retorno = 'T';
			break;
		case 0xF000000E://FALSE
			retorno = 'A';
			break;
		case 0xF0000010:
			retorno = '>';
			break;
		case 0xF0000011:
			retorno = '<';
			break;
		case 0xF0000012://Igualdade
			retorno = '=';
			break;
		case 0xF0000013://And logico
			retorno = '&';
			break;
		case 0xF0000014://Or logico
			retorno = '|';
			break;
		case 0:
			retorno = '\0';
			break;
	}

	return retorno;
}

/*Procedimento dedicado a impressao do grado no console
 * para verificar se o grafo criado esta correto.
 * */
void imprime_grafo_para_string(Celula *cel){

	if(cel->fesq != NULL){
		imprime_grafo_para_string(cel->fesq);
	}
	else if(cel->tipo == 0xF0000008){
		printf("grafo Errado");
		exit(0);
	}
	if(cel->fdir != NULL){
		if(cel->fdir->tipo  == 0xF0000008){
			printf("(");
			imprime_grafo_para_string(cel->fdir);
			printf(")");
		}
		else{
			imprime_grafo_para_string(cel->fdir);
		}
	}
	else if(cel->tipo == 0xF0000008){
		printf("grafo Errado");
		exit(0);
	}

	if(cel->tipo != 0xF0000008){
		printf("%c",converte_celula_caractere(cel->tipo));
	}
}

void imprime_grafo(Celula *cel){
	//printf("%c",cel->tipo);
	if(cel->fesq != NULL){
		imprime_grafo(cel->fesq);
	}
	printf("%c",cel->tipo);
	if(cel->fdir != NULL){
		imprime_grafo(cel->fdir);
	}
}

/*Procedimento empilha celulas das de a raiz ate o elemento mais externo mais
 * a esquerda
 * */
void empilha_grafo(Celula *grafo){
	Celula *g = grafo;
	while(g != NULL){
		push(g);
		g = g->fesq;
	}
}

