/*Procedimento efetua a reduo do operador soma segundo a notao prefixa
 * + a b = (eval a) + (eval b)
 * Onde eval  a reduo da sub arvore do argumento do operador
 * */
void reduz_SOMA(Celula *grafo){
	contar_argumentos(2);
	pop();//desempilha +

	//Busca argumento
	Celula *a = eval(pilha[topo]->fdir); //avalia e atribui A
	pop();
	Celula *b = eval(pilha[topo]->fdir); //avalia e atribui B
	pop();
	//Aloca dados
	Celula *result  = aloca_espaco();
	result->tipo = a->tipo + b->tipo;
	result->fesq = NULL;
	result->fdir = NULL;

	Celula *pai = NULL;

	if(topo >= 0){
		pai = pilha[topo];
	}

	if(pai!=NULL){
		pai->fesq = result;
	}
	else{
		grafo->tipo = result->tipo;
		grafo->fesq = result->fesq;
		grafo->fdir = result->fdir;
	}
}


